import styled from 'styled-components';

export const StyledHomeLog = styled.div`
  
  width: 100%;
  height: 100%;

  & ul {
    padding-bottom: 25px;
  }
  & .MuiPagination-root {
    // border: 1px dotted green;    
    margin-top: 0%;
    margin-bottom: 0%;
    padding-bottom: 3%;
  }
  & .MuiPagination-ul {
    padding: 0;
  }
`;
